  import React, { useState } from "react";
import "./css/Menu.css";
import mylogo from "./img/logo2.png";
import { Link } from "react-router-dom";
import Modal from "react-modal";
import ModalLogin from "./Modal/ModalLogin";
import cancela from "./img/cancela.svg";
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import PersonIcon from '@material-ui/icons/Person';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import IconButton from '@material-ui/core/IconButton';
import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';
import InputAdornment from '@material-ui/core/InputAdornment';


function Menu() {

  const [Login, SetLogin] = useState(false);
  const [SignUp, SetSignUp] = useState(false);

  const handleClickShowPassword = () => {
  setValues({ ...values, showPassword: !values.showPassword });
  };
  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };
  const [values, setValues] = React.useState({
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  });
  const handleChange = (prop) => (event) => {
    setValues({ ...values, [prop]: event.target.value });
  };

  function HandleCloselogin(){
    SetLogin(false);
  }
  function HandleCloseSignUp(){
    SetSignUp(false);
  }
  function SignUpPopUp(){
    SetLogin(false);
    SetSignUp(true);
  }
  return (
    <nav className="poss">
      <div className="myMenu">
        <a className="pil pil_push" href="/">
          <img className="mylog" src={mylogo} width="80px" alt="" />
        </a>

        <div className="" id="navbarNav">
          <ul className="">
            <li className="">
              <Link className="pil" to="/">
                Home
              </Link>
            </li>
            <li className="">
              <a className="pil" href="/">
                Annonces
              </a>
            </li>
            <li className="">
              <a className="pil" href="/">
                About us
              </a>
            </li>
            <li className="">
              <a className="pil" href="/">
                Pricing
              </a>
            </li>
            <li className="Speciall">
              <button className="pil mycadr" onClick={() => SetLogin(true)}>
                Se connecter
              </button>
